* {
    margin: 0;
    padding: 0;
}

li {
    list-style: none;
}

a {
    text-decoration: none;
    color: #000;
}


/************ color **************/
$color: #fcf9ee;

$font-family: 'KOTRA_GOTHIC';

p,
span,
ul,
li,
div,
/* button, */
a {
    letter-spacing: 1px;
    font-family: 'Bookk Myungjo';
}

body {
    background-color: $color;
}


.rolling_banner {
    overflow: hidden;
    display: flex;
    width: 100%;

    background: #000;

    .rolling {
        display: flex;
        height: 40px;

        >li {
            font-size: 14px;
            width: 1300px;
            color: #fff;
            line-height: 40px;
            font-family: 'KOTRA_GOTHIC ';


        }
    }
}

@keyframes flowRolling {
    0% {
        transform: translateX(0);
    }

    100% {
        transform: translateX(-100%);
    }
}

.fixed {
    position: fixed;
    top: 0;
    left: 0;
}

.header {
    position: absolute;
    width: 100%;
    height: 80px;
    border-bottom: 1px solid #fff;
    z-index: 1;
    transition: 0.3s;


    &:hover {
        /*    height: 150px; */
        background-color: $color;

        .header_inner{
            .logo{
                >a{
                    color: #222;
                }
            }
           
        }

        .header_inner .lnb .menu a {
            color: #222;
            font-weight: bold;
        }

        .header_inner .gnb {
            filter: invert(100%);
            /* 블랙만들기 */
        }

        .lnb {
            .menu {
                a {
                    color: #222;
                }
            }
        }

    }


    .header_inner {
        position: relative;
        width: 1300px;
        margin: 0 auto;
        display: flex;
        

        .logo {
            color: $color;
            padding: 10px 0;
            margin-left: 45px;
            width: 185px;
            text-align: center;
            /*  &:hover{color: #222;} */
            cursor: pointer;
            >a{ color: $color;
                p {
                    font-size: 32px;
                    font-weight: bold;
                    /*  letter-spacing: 3px; */
                }
    
                span {
                    font-size: 12px;
                    font-weight: bold;
                    letter-spacing: 8px;
                }
            }
        }

        /************ lnb_menu ********/
        .lnb {
            width: 800px;
            position: relative;

            .menu {
                position: absolute;
                margin-left: 45px;
                margin-top: 40px;
                float: left;
                color: #fff;

                &:hover a {
                    color: #666;
                }

                &:hover ul {
                    display: block;
                }

                >a {
                    /* font-weight: bold; */
                    font-size: 20px;
                    color: #fff;
                }

                ul {
                    overflow: hidden;
                    display: none;
                    margin-top: 30px;

                    li {
                        float: left;
                        margin-right: 50px;

                        a {

                            font-size: 14px;
                            font-family: $font-family;

                            &:hover {
                                color: #222;
                            }
                        }



                    }
                }
            }

            .new {
                left: 0px;
            }

            .sent {
                left: 120px
            }

            .shop {
                left: 240px
            }

            .about {
                left: 360px
            }
        }
    }

    /*************** gnb  *****************/
    .gnb {
        position: absolute;
        right: 20px;
        margin-top: 40px;
        width: 140px;

        li {
            float: left;
            margin-right: 25px;
            /*   cursor: pointer; */
            cursor: pointer;
            transition: 0.3s;

            &:hover {
                scale: 1.08;
            }

            &:nth-child(3) {
                margin-right: 0;
            }

            img {
                width: 25px;
                height: 25px;
            }

        }
    }
}

/* search */
.search_ex {
    display: none;
    position: absolute;
    z-index: 1;
    width: 100%;
    height: 300px;
    background-color: $color;

    .search_inner {
        position: relative;
        width: 1300px;
        margin: 0 auto;
        text-align: center;
        box-sizing: border-box;


        button {
            position: absolute;
            font-family: $font-family;
            top: 30px;
            right: 30px;
            border: none;
            background: none;
            font-size: 25px;
            cursor: pointer;
        }

        .logo {
            width: 185px;
            margin-top: 10px;
            margin-left: 45px;
            text-align: center;
            color: #222;
            cursor: pointer;

            p {
                font-size: 30px;
                font-weight: bold;
                /* letter-spacing: 3px; */
            }

            span {
                font-size: 12px;
                font-weight: bold;
                letter-spacing: 8px;
            }
        }

        input {
            font-family: $font-family;
            font-size: 20px;
            width: 990px;
            border: none;
            margin-top: 60px;
            border-bottom: solid #222 1px;
            padding-bottom: 10px;
            padding-left: 40px;
            box-sizing: border-box;
            background: none;


            &::placeholder {
                margin-left: 50px;
                color: #999;
            }

            &:focus {
                outline: none;
            }
        }

        img {
            position: absolute;
            top: 125px;
            right: 170px;
            width: 25px;
            height: 25px;
            cursor: pointer;

            &:hover {
                scale: 1.05;
            }
        }

        label {
            position: absolute;
            color: #aaa;
            left: 270px;
        }

        .search_txt {
            margin: 0 auto;
            margin-top: 40px;
            width: 1000px;
            display: flex;
            justify-content: space-between;

            p {
                font-family: $font-family;
                height: 40px;
                background-color: #fff;
                line-height: 40px;
                padding: 0 15px;
                border: 1px solid #222;
                border-radius: 3px;
                cursor: pointer;

                &:hover {
                    background-color: #222;
                    color: #fff;
                }
            }
        }
    }
}

/************ visual_main **************/
.visual_main {
    width: 100%;
    margin-bottom: 200px;

    video {
        width: 100%;
        height: 100%;
    }
}

.wrap {
    width: 1300px;
    margin: 0 auto;
}

/************ wrap **************/
.wrap {
    >p {
        margin-bottom: 20px;
        margin-left: 40px;
        font-size: 30px;
    }

    .contents {
        height: 700px;
        margin-bottom: 200px;


        .contents_left {
            position: relative;
            float: left;
            width: 680px;
            height: 700px;
            background-color: #fff;
            overflow: hidden;
            margin-right: 20px;
            cursor: pointer;

            &:hover {
                .contents_left_back {
                    display: block;
                }
            }

            .img01 {
                width: 100%;
                transform: translateY(-250px);
            }

            .contents_left_back {
                display: none;
                position: absolute;
                width: 100%;
                height: 100%;
                background-color: #222;
                opacity: 0.8;
                z-index: 1;
                text-align: center;

                h5 {
                    margin-top: 200px;
                    font-size: 25px;
                    color: $color;
                    letter-spacing: 2px;
                }

                p {
                    margin-top: 20px;
                    font-family: $font-family;
                    color: $color;
                    text-align: left;
                    margin-left: 60px;
                    line-height: 30px;
                }

                button {
                    font-size: 16px;
                    margin-top: 100px;
                    margin-left: 120px;
                    width: 300px;
                    height: 50px;
                    border-radius: 3px;
                    background-color: #fff;
                    font-weight: bold;
                    letter-spacing: 1px;
                    font-family: $font-family;
                    cursor: pointer;

                    &:hover {
                        background-color: #000;
                        color: $color;
                        border: 1px solid $color;

                    }
                }
            }
        }

        .contents_right {
            float: left;
            /*   overflow: hidden; */
            width: 600px;
            height: 700px;
            background-color: #fff;

            .newSwiper1 {
                width: 600px;
                height: 490px;
                text-align: center;
                cursor: pointer;
                transition: 0.5s;

                .swiper-wrapper {
                    transition: 0.5s;
                }

                &:hover {
                    >.swiper-wrapper .contnets_swiper_back {
                        display: block;
                    }
                }

                >.swiper-wrapper {
                    .contnets_swiper_back {
                        display: none;
                        position: absolute;
                        width: 100%;
                        height: 490px;
                        z-index: 1;

                        .contents_back_inner {
                            background-color: #fff;
                            width: 100%;
                            height: 500px;
                            opacity: 0.8;
                        }

                        .contents_txt {
                            position: absolute;
                            top: 35%;
                            left: 25%;

                            h5 {
                                font-size: 20px;
                            }

                            p {
                                margin-top: 20px;
                                font-size: 18px;
                                font-family: $font-family;
                            }

                            button {
                                font-size: 18px;
                                font-family: $font-family;
                                margin-top: 50px;
                                width: 300px;
                                height: 40px;
                                border-radius: 3px;
                                background-color: #222;
                                color: #fff;
                                cursor: pointer;
                                transition: 0.2s;

                                &:hover {
                                    background-color: #fff;
                                    color: #222;
                                }

                            }
                        }
                    }


                    img {
                        width: 75%;
                        transform: translateY(-20px);
                        cursor: pointer;

                    }
                }

                .swiper-button-next {
                    top: var(--swiper-navigation-top-offset, 60%);
                }

                .swiper-button-prev {
                    top: var(--swiper-navigation-top-offset, 60%);
                }
            }

            .newSwiper2 {
                width: 600px;
                height: 200px;

                >.swiper-wrapper {

                    /*         padding: 0 20px; box-sizing: border-box; */

                    .swiper-slide {
                        img {
                            width: 70%;
                            transform: translateX(18px);
                            cursor: pointer;
                            transition: 0.3s;
                            opacity: 0.6;

                            &:hover {
                                scale: 1.05;
                            }
                        }
                    }

                    .swiper-slide-thumb-active {
                        img {
                            opacity: 1;
                        }
                    }
                }

            }

        }
    }

    .contents02 {
        height: 650px;
        position: relative;
        width: 1300px;
        margin-bottom: 200px;

        .contents02_img {
            img {
                background: url(../image/main/contents02_1.jpg);
                position: absolute;
                display: none;
                width: 100%;
                z-index: -1;
            }

            /*  .page_img1{display: none;}
            .page_img2{display: block;} */
            .page_img1 {
                display: block;
            }
        }

        .contents02_page {
            width: 325px;
            height: 650px;
            float: left;

            .contents02_txt {
                position: absolute;
                bottom: 40px;
                color: #fff;
                right: 20px;

                h5 {
                    font-size: 30px;
                    letter-spacing: 1px;
                }

                p {
                    text-align: right;
                    margin-top: 5px;
                    margin-right: 5px;
                    font-size: 25px;
                    font-family: $font-family;
                }

            }

        }


        .page1 {
            position: relative;

            .contents02_back {
                display: none;
                position: absolute;
                background-color: #222;
                width: 325px;
