                opacity: 0.8;
            }

            .logo {
                position: absolute;
                top: 23%;
                left: 25px;
                color: #fff;
                padding: 10px 0;
                margin-left: 45px;
                width: 185px;
                text-align: center;

                p {
                    font-size: 30px;
                    font-weight: bold;
                    /*  letter-spacing: 3px; */
                }

                span {
                    font-size: 12px;
                    font-weight: bold;
                    letter-spacing: 8px;
                }
            }

        }

        .page2 {
            position: relative;

            &:hover .contents02_back {
                display: none;
            }

            .contents02_back {
                position: absolute;
                right: 0;
                background-color: #222;
                width: 322px;
                height: 650px;
                opacity: 0.8;
            }
        }

        .page3 {
            position: relative;

            &:hover .contents02_back {
                display: none;
            }

            .contents02_back {
                position: absolute;
                right: 0;
