            }

            /*  .page4:hover ~ .page_img2{
                background: url(../image/main/contents02_4.jpg);
            } */
        }
    }

    .container {
        width: 1300px;
        height: 598px;
        overflow: hidden;

        .best {
            float: left;
            overflow: hidden;
            width: 530px;
            height: 598px;

            img {
                width: 100%;
                transform: translateY(-115px);
                scale: 1.2;
            }
        }

        ul {
            float: left;
            width: 760px;
            height: 598px;
            display: flex;
            flex-wrap: wrap;
            justify-content: space-between;

            li {
                position: relative;
                width: calc((100% - 50px) / 3);
                margin-bottom: 20px;
                background-color: #fff;
                text-align: center;
                cursor: pointer;

                &:nth-child(2),
                &:nth-child(5) {
                    margin: 0 25px;
                    margin-bottom: 20px;
                }

                &:nth-child(4),
                &:nth-child(5),
                &:nth-child(6) {
                    margin-bottom: 0;
                }

                img {
                    margin-top: 30px;
                    width: 184px;
                    height: 184px;
                    transform: translateY(-10px);
                }

                h5 {
                    font-size: 14px;
                }

                p {
                    margin-top: 8px;
                    font-family: $font-family;
                    font-size: 14px;
                }

                &:hover h5 {
                    display: none;
                }

                &:hover p {
                    display: none;
                }

                &:hover button {
                    display: block;

                }

                button {
                    display: none;
                    position: absolute;
                    left: 30px;
                    bottom: 30px;
                    width: 180px;
                    height: 35px;
                    background-color: #222;
                    color: $color;
                    border-radius: 30px;
                    cursor: pointer;
                    transition: 0.3s;

                    &:hover {
                        background-color: #fff;
                        color: #222;
                    }
                }

            }
        }

    }

    .contents03 {
        position: relative;
        /*    width: 1300px;
        height: 300px; */
        margin-top: 20px;
        overflow: hidden;
        /* margin-bottom: 200px; */

        div {
            width: 1300px;
            height: 300px;
            overflow: hidden;

            img {
                width: 100%;
                transform: translateY(-130px);
            }

            h5 {
                top: 80px;
                left: 50%;
                transform: translateX(-50%);
                position: absolute;
                font-size: 40px;
                color: #fff;
                font-weight: normal;

            }

            button {
                position: absolute;
                top: 165px;
                left: 50%;
                transform: translateX(-50%);
                width: 330px;
                height: 65px;
                border: none;
                opacity: 0.8;
                box-shadow: 3px 3px 5px #888;
                cursor: pointer;
                transition: 0.3s;

                &:hover {
                    background-color: #FFF7D3;
                }
            }

            p {
                top: 170px;
                left: 50%;
                transform: translateX(-50%);
                font-size: 35px;
                position: absolute;
                /* color: #fff; */
                cursor: pointer;

            }
        }

        ul {
            display: none;
            position: relative;
            width: 1300px;
            height: 600px;
            background-color: #fff;
            text-align: center;
            /*  display: flex; */
            align-items: center;
            justify-content: center;

            >img {
                position: absolute;
                height: 600px;
            }

            >p {
                position: absolute;
                top: 90px;
                font-size: 25px;
                font-family: $font-family;
                color: #fff;
            }

            li {
                z-index: 1;
                margin-top: 30px;
                width: 310px;
                height: 315px;
                background-color: #fff;
                text-align: center;

                &:nth-child(4) {
                    margin: 0 20px;
                    margin-top: 30px;
                }

                >img {
                    width: 260px;
                }

                p {
                    font-family: $font-family;
                }


                button {
                    display: none;
                }

            }
        }

    }

    .contents04 {
        position: relative;
        text-align: center;
        margin-top: 200px;
        width: 1300px;
        height: 630px;
        margin-bottom: 20px;


        .contents04_tab {
            position: absolute;
            z-index: 1;
            top: -30px;
            left: 90px;
            width: 130px;
            height: 660px;

            /*       background-color: #222; */
            >div {
                position: absolute;
                width: 100%;
                height: 100%;
                background-color: #222;
            }

            >li {
                position: absolute;
                top: 45px;
                width: 90px;
                height: 90px;
                left: 20px;
                background-color: $color;
                cursor: pointer;

                >div {
                    position: absolute;
                    width: 70px;
                    height: 70px;
                    top: 10px;
                    left: 10px;
                    cursor: pointer;

                    &::before,
                    &::after {
                        content: "";
                        position: absolute;
                        width: 20px;
                        height: 20px;
                        transition: 0.2s ease-in-out;
                    }

                    &::before {
                        top: -5px;
                        left: -5px;
                        border-top: 1px solid #222;
                        border-left: 1px solid #222;
                    }

                    &::after {
                        right: -5px;
                        bottom: -5px;
                        border-bottom: 1px solid #222;
                        border-right: 1px solid #222;
                    }

                    &:hover::before,
                    &:hover::after {
                        width: calc(100% + 9px);
                        height: calc(100% + 9px);
                    }
                }

                >p {
                    font-family: $font-family;
                    margin-top: 25px;
                }

                >h5 {
                    font-family: $font-family;
                }
            }


            #rain {
                top: 165px;
            }

            #business {
                top: 285px;
            }

            #anniversary {
                top: 405px;
            }

            #christmas {
                top: 525px;
            }
        }


        .contents04_sheet {
            position: relative;
            float: left;
            width: 1300px;
            height: 600px;
            margin-bottom: 200px;
            background-color: #ddd;
            overflow: hidden;

            >img {
                left: 0;
                width: 1300px;
                position: absolute;
                opacity: 0.7;
            }

            >p {
                position: absolute;
                margin-top: 120px;
                left: 50%;
                transform: translateX(-25%);
                font-size: 25px;
                font-family: $font-family;
                color: #fff;
            }

            >div {
                margin-top: 90px;
                margin-left: 310px;
                display: flex;

                .center {
                    margin: 0px 20px;
                }

                >p {
                    width: 260px;
                    height: 335px;
                    border-radius: 10px;
                    background-color: #fff;
                    opacity: 0.7;
                }
            }

            >li {
                position: absolute;
                width: 260px;
                height: 335px;
                cursor: pointer;

                img {
                    width: 100%;
                }

                h5 {
                    /*  font-size: 14px; */
                    margin-bottom: 8px;
                }

                p {
                    font-family: $font-family;
                }

                &:hover button {
                    display: block;
                }

                &:hover {
                    p {
                        display: none;
                    }

                    h5 {
                        display: none;
                    }
                }

                button {
                    display: none;
                    position: absolute;
                    left: 40px;
                    bottom: 30px;
                    width: 180px;
                    height: 35px;
                    background-color: #222;
                    color: $color;
                    border-radius: 30px;
                    cursor: pointer;
                    transition: 0.3s;

                    &:hover {
                        background-color: #fff;
                        color: #222;
                    }
                }
            }

            .sheet_left {
                top: 180px;
                left: 310px;
            }

            .sheet_center {
                top: 180px;
                left: 590px;
            }

            .sheet_right {
                top: 180px;
                left: 870px;
            }

        }

        .date_sheet {
            display: none;
        }

        .rain_sheet {
            display: none;

            >p {
                transform: translateX(-30%);
            }
        }

        .business_sheet {
            display: none;
        }

        .anniversary_sheet {
            display: none;

            >p {
                transform: translateX(-30%);
            }

            /*   >img{height: 100%;} */
        }

        .christmas_sheet {
            display: none;

            >p {
                transform: translateX(-30%);
            }
        }

        .sheet_on {
            display: block;
        }

    }

    .contents05 {
        width: 1300px;
        height: 280px;
        background-color: $color;

        .instar {
            width: 100%;
            height: 100%;

            .swiper-wrapper {
                position: relative;

                .swiper-slide {
                    width: 280px;
                    height: 280px;
                    text-align: center;
                    font-size: 18px;
                    background-color: #ddd;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    /* overflow: hidden; */
                    cursor: pointer;

                    &:hover>img {
                        transform: translateY(-5px);
                    }

                    &:hover .insta_txt {
                        bottom: 0;
                    }

                    .shopping_icon {
                        position: absolute;
                        top: 10px;
                        right: 10px;
                        width: 30px;
                        height: 30px;
                        background-color: #000;
                        border-radius: 50%;

                        &:hover {
                            background-color: #fff;

                            img {
                                filter: invert(100%);
                            }
                        }

                        img {
                            width: 100%;
                        }
                    }

                    >img {
                        display: block;
                        width: 100%;
                        height: 100%;
                        object-fit: cover;
                        transition: 0.3s;
                    }

                    .insta_txt {
                        position: absolute;
                        width: 250px;
                        height: 70px;
                        bottom: -70px;
                        transition: 0.3s;

                        .insta_txt_bg {
                            position: absolute;
                            top: 0;
                            background-color: #222;
                            opacity: 0.5;
                            width: 250px;
                            height: 70px;
                            border-radius: 30px 30px 0 0;
                        }

                        .insta_name {
                            position: absolute;
                            left: 50%;
                            transform: translateX(-50%);
                            margin-top: 15px;
                            color: #fff;
                            position: absolute;
                            letter-spacing: 1px;
                            font-size: 14px;
                        }

                        .insta_text {
                            position: absolute;
                            margin-top: 40px;
                            left: 50%;
                            transform: translateX(-50%);
                            color: #fff;
                            font-size: 12px;
                            width: 200px;
                            overflow: hidden;
                            font-family: $font-family;
                            text-overflow: ellipsis;
